window.bookSummaryJSON = "<p>What's better than one sexy book? Four romance novels - packaged into one delicious audio bundle, narrated by Sebastian York! <i>Bigger Rock</i> is the only bundle for the number one <i>NYT</i> best-selling Big Rock series, and it includes the first four audio books - <i>Big Rock</i>, <i>Mister O</i>, <i>Well Hung</i>, and <i>Full Package</i>....&nbsp;&nbsp;</p> <p>Once upon a time there was a cocky, confident, die-hard bachelor living it up in New York City. He was clever and charming, and he’d been living the good life. Then, one special woman - one very sassy, confident, and fantastic woman - knocked him on his butt, thanks to love that came out of the blue. Take that story and multiply it by four. That’s what’s in the Bigger Rock box set - four <i>New York Times</i> best-selling romantic comedies, told in the male POV, that established Lauren Blakely as at the top of her game in rom-com! You’ll find friends-to-lovers, best-friend’s-little-sister, boss-assistant, and roomies-to-lovers romances. Come meet the irreverent bachelor Spencer Holiday in <i>Big Rock</i>, the hot nerd Nick Hammer in <i>Mister O</i>, his twin brother, Wyatt, the sarcastic and sweet carpenter, in <i>Well Hung</i>, and the charming and brilliant doctor with the heart of gold, Chase Summers, in the number one <i>New York Times</i> best-selling smash hit <i>Full Package</i>. Get ready for a hot and hilarious ride!</p>"; 
